Step-by-step reasoning:
1. Key psychological mechanisms: In the Fehr–Schmidt model, individuals experience psychological guilt when they receive more than their opponent. This guilt reduces the utility of an outcome even if monetary gains are high.
2. Mechanism interaction: When the responder is offered a split where split_self > split_opp, the utility is the monetary amount (split_self) diminished by a penalty proportional to the inequality (split_self – split_opp). A learnable parameter (beta) scales the weight of guilt.
3. Mathematical form: The utility for accepting an offer is modeled as
  Utility = split_self − beta × (split_self − split_opp)
since the maximum function simplifies when split_self is always greater than split_opp.
4. Parameters: The only learnable parameter is beta, which quantifies guilt sensitivity. It is bounded between 0 and a generous upper bound (e.g., 5).
5. Mapping to behavior: Observed variables split_self and split_opp come directly from the dataset. The model computes the net utility for accepting an offer; higher utility increases the probability of acceptance (indirectly through a choice function not modeled here).

Below is the formal model specification, variable descriptions, and a concise summary.

<MODEL>
U = split_self - beta*(split_self - split_opp)
</MODEL>

